import React from 'react';
import '../css/footer.css'

function Footer() {
    return (
        <React.Fragment>
            <footer>
                <div className="footer-container">
                <h5>Wikipedia</h5>
                <p>Wikipedia is a multilingual online encyclopedia created and 
                    maintained as an open collaboration project by a community 
                    of volunteer editors using a wiki-based editing system. It 
                    is the largest and most popular general reference work on 
                    the World Wide Web.</p><br/>
                    </div>


            </footer>
        </React.Fragment>
    )
}


export default Footer;
